const MessageContainer = (messages)=>{

    const msgs = ["hi", "hello", "hey", "how are you?", "What are you doing?"]
    return <div>
            
            {console.log(messages[0].msg, typeof(messages))}
        {
            msgs.map((msg, index) =>{
                <table striped="true">
                    <tr key={index}>
                        <td>{index} - {msg}</td>
                    </tr>
                    </table>
            })
        }
        
    </div>
}

export default MessageContainer;
